import React from 'react';
import styles from './App.css';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import CssBaseline from '@material-ui/core/CssBaseline';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import SearchIcon from '@material-ui/icons/Search';
import HomeIcon from '@material-ui/icons/Home';
import CreateIcon from '@material-ui/icons/Create';
import AndroidIcon from '@material-ui/icons/Android';
//import CreateIcon from '@material-ui/icons/Create';
import SettingsIcon from '@material-ui/icons/Settings';

const drawerWidth = 100;


export default function BartenderDrawer() {
  const classes = makeStyles((theme) => ({
			root: {
				display: 'flex',
			},
			appBar: {
				width: `calc(100% - ${drawerWidth}px)`,
				marginLeft: drawerWidth,
			},
			drawer: {
				width: drawerWidth,
				flexShrink: 0,
			},
			drawerPaper: {
				width: drawerWidth,
			},
			// necessary for content to be below app bar
			toolbar: theme.mixins.toolbar,
			content: {
				flexGrow: 1,
				backgroundColor: theme.palette.background.default,
				padding: theme.spacing(3),
			},
		  drawerIcon: {
				fontSize: 44
			},
		}));

  return (
      <Drawer
        className={classes.drawer}
        variant="permanent"
        classes={{
          paper: classes.drawerPaper,
        }}
        anchor="left"
		    style={{ flexShrink: 0 }}
      >
        <div className={classes.toolbar} />
        <List>
					<ListItem button key="Home">
						<HomeIcon style={{ fontSize: 44 }}/>
					</ListItem>
					<Divider/>
					<ListItem button key="Search">
						<SearchIcon style={{ fontSize: 44 }}/>
					</ListItem>
					<Divider/>
					<ListItem button key="Create">
						<CreateIcon style={{ fontSize: 44 }}/>
					</ListItem>
					<Divider/>
					<ListItem button key="Android">
						<AndroidIcon style={{ fontSize: 44 }}/>
					</ListItem>
					<Divider/>
					<ListItem button key="Settings">
						<SettingsIcon style={{ fontSize: 44 }}/>
					</ListItem>
        </List>
      </Drawer>
  );
}
